'''Count Check''' is a [[vampyre]] in the [[Lumbridge#Graveyard|Lumbridge graveyard]], south of the church. He advises players to have unique passwords and to enable two-step verification for their registered recovery email. He also checks whether the player has the [[RuneScape Authenticator|Authenticator]] enabled and a [[Bank PIN]].

He also is able to teleport players to the entrance of the [[Stronghold of Security]] to learn more about account security, however this can only be done once.

The player may ask Count Check to count for them, prompting him to recite four tips for account security:
* One... unique password.
* Two... step email verification.
* Free... authenticator.
* Four... digit bank PIN!

